import Vue from 'vue'
import VueRouter from 'vue-router'


import MyLogin from "@/views/Login/MyLogin.vue";
import MyMain from '@/views/Home/MyMain.vue'
import UserList from "@/views/Home/User/UserList.vue";
import MovieList from "@/views/Home/Movie/MovieList.vue";
import MovieCategory from "@/views/Home/Category/MovieCategory.vue";
import MovieAdvertise from "@/views/Home/Advertise/MovieAdvertise.vue";
import AddMovie from "@/views/Home/Movie/AddMovie.vue";
import MoviePlan from "@/views/Home/Plan/MoviePlan.vue";
import MovieHall from "@/views/Home/Hall/MovieHall.vue";
import OrderList from "@/views/Home/Order/OrderList.vue";


Vue.use(VueRouter)

const routes = [
  {
    path:'/register',
    name:'register',
    component: ()=>import ('@/views/Login/MyRegister.vue'),
  },
  {
    path:'/',
    name:'login',
    component: MyLogin
  },
  {
    path: '/home',
    name: 'main',
    component:MyMain,
    children:[
      {
        path:'/home/userList',
        component: UserList,
      },

      {
        path:'/home/movieList',
        component: MovieList
      },
      {
        path:'/home/movieCategory',
        component: MovieCategory,
      },
      {
        path:'/home/addMovie',
        component: AddMovie,
      },
      {
        path:'/home/movieAdvertise',
        component: MovieAdvertise,
      },
      {
        path: '/home/moviePlan',
        component: MoviePlan
      },
      {
       path:'/home/movieHall',
       component: MovieHall
      },
      {
        path:'/home/orderList',
        component: OrderList
      }
    ],

  },
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
